import React, { Component,useEffect } from 'react';
import './contact.css';
import Aos from 'aos';
import 'aos/dist/aos.css';
import Img from './contact.jpeg';
import Img1 from './linkedin.png';

const Contact = () => {
    useEffect(() => {
        Aos.init({duration:1500});
    },[]);

    return (
        
    	<div id='contact'>
           <div className='parallx' 
            style={{backgroundImage:'url(' + Img + ')',height:'auto',maxWidth:'100%'}}>
            <div className='ovrly'>
                <div style={{zIndex:2}}>
                  <h1 className='head1' style={{padding:40}}>CONTACT</h1>
                  <h3 className='head2' style={{color:'white',marginTop:-37,fontFamily:'B612 Mono'}}>
                  GET IN TOUCH</h3>
                     <div className='container'>
                    <div data-aos='zoom-in' className='grid-item'>
                        <h4 
                        style={{marginLeft:0,marginTop:40,fontWeight:'bold',fontFamily:'Architects Daughter'}}> 
                        <img src={Img1} className='contactsrc'/>
                        LinkedIn </h4>
                    </div>
                    <div data-aos='zoom-in' className='grid-item'>
                        <h5 style={{textAlign:'center',marginTop:50}}> Gmail </h5>
                    </div>
                    <div data-aos='zoom-in' className='grid-item'>
                         <h5 style={{textAlign:'center',marginTop:50}}> Github </h5>
                    </div>
                    <div data-aos='zoom-in' className='grid-item'>
                         <h5 style={{textAlign:'center',marginTop:50}}> Facebook </h5>
                    </div>   
                </div>    
            </div>
            </div>
            </div>
            
        </div>
    );
}

export default Contact;
